import React from "react";
import "./style.css";
import Header from "./Header";
import NewFactForm from "./NewFactForm";
import CategoryFilter from "./CategoryFilter";
import FactsList from "./FactsList";

function App() {
  return (
    // 
    <>
      <Header />
      <NewFactForm />
      <main className="main">
        <CategoryFilter />
        <FactsList />
      </main>
    </>
  );
}

export default App;
